<div class="v16 ps138 s176 c128">
<div class="ps145 v15 s177">
<div class="v16 ps146 s178 c129">
<h1 class="p14 f42">Equipment</h1>
</div>
</div>
</div>
<div class="ps147 v15 s179">
<div class="v16 ps148 s180 c130">
<p class="p14 f43">We use a vastly different type of philosophy when it comes to our selection of equipment. We select our equipment using extensive business strategic analysis and planning. The result is equipment offering the perfect strategic combination of power and performance. We believe that you must always select the appropriate tool for the job being completed. In order to offer superior services, you must first obtain superior equipment. This is why we use the philosophy of operating new equipment. New equipment allows us to incorporate the latest technology into every job, such as an advanced laser scanning depth, pitch, and grade technology for extremely accurate and precise results.&nbsp;</p>
<p class="p14 f43"><br></p>
<p class="p14 f43">Every machine is purposely loaded with the latest software that enables advanced techniques to be employed. Features such as Real-Time GPS Tracking, Gyroscopes, Accelerometers, Compass Heading, Barometers, Altimeters, Load Sensors, Laser Scanning, and 4G Built-in Wireless, enable us to incorporate next-generation technology into every job we perform. Importantly it enables precision in operation that simply is not possible without this capability. We use this technology to create geometric maps of the local work area on-site, map out boundaries, precisely define working area, determine elevations, and identify pitch grades in real-time.&nbsp;</p>
<p class="p14 f43"><br></p>
<p class="p14 f43">Excavation historically required massive sized machines to complete basic tasks. These excavators are very difficult to maneuver, essentially destroy their surrounding areas, limited in operational capabilities, and have very poor efficiency to power ratios. Today we are able to achieve even better results, using more compact platforms. These platforms deliver more power and efficiency than large excavators of the past, while allowing operators in much smaller areas. We make use of the optimal performance, efficiency, size, and technology offered by the Kubota. Kubota has consistently demonstrated reliability, durability, with unique operational/performance characteristics. The equipment is built stronger/larger hydraulic systems, stronger welds, and thicker steel. The equipment we have selected outperforms every single manufacturer in its class.&nbsp;</p>
<p class="p14 f43"><br></p>
<p class="p14 f43">Kubota has the distinctive advantage of in-house design and production of their own diesel engines. Similar to how Apple designs in-house specific chips for each device, Kubota uses distinct variations of many engines, unique to each individual models needs. The machine and the engine are co-developed around one another allowing the engine, hardware, and software to be tightly integrated creating a superior product. Kubota is unique among equipment manufactures, as they are the only ones to specifically develop their own engines. The other brands, such as John Deere, CAT, Case, JCM, etc:..use OEM manufacturers engines. This is the equivalent of designing a tractor to specs, then adding the engine in as an afterthought, and hoping everything works smoothly. Using an engine that is purposely designed allows optimization of the platform to make full use of the engine&rsquo;s capabilities.&nbsp;</p>
</div>
